var board;
var solve = function(board) {


    var x_length = board.length - 1;
    var y_length = board[0].length - 1;
    var i, j;
    var checkAvaliable = function(x, y) {
        if (x - 1 >= 0) {
            if (board[x - 1][y] == "O") {
                board[x - 1][y] = "OK";
                checkAvaliable(x - 1, y);
            }
        }
        if (y - 1 >= 0) {
            if (board[x][y - 1] == "O") {
                board[x][y - 1] = "OK";
                checkAvaliable(x, y - 1);
            }
        }
        if (x + 1 <= x_length) {
            if (board[x + 1][y] == "O") {
                board[x + 1][y] = "OK";
                checkAvaliable(x + 1, y);
            }
        }
        if (y + 1 <= y_length) {
            if (board[x][y + 1] == "O") {
                board[x][y + 1] = "OK";
                checkAvaliable(x, y + 1);
            }
        }
    }
    for (i = 0; i <= x_length; i++) {
        if (board[i][0] == "O") {
            board[i][0] = "OK";
            checkAvaliable(i, 0);
        }
        if (board[i][y_length] == "O") {
            board[i][y_length] = "OK";
            checkAvaliable(i, y_length);
        }
    }
    for (j = 0; j <= y_length; j++) {
        if (board[0][j] == "O") {
            board[0][j] = "OK";
            checkAvaliable(0, j);
        }
        if (board[x_length][j] == "O") {
            board[x_length][j] = "OK";
            checkAvaliable(x_length, j);
        }
    }
    for (i = 0; i <= x_length; i++) {
        for (j = 0; j <= y_length; j++) {
            if (board[i][j] == "OK") {
                board[i][j] = "O";
            } else {
                board[i][j] = "X";
            }
        }
    }
};
